// src/components/Dashboard.js
import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
 import { fetchUserGrounds } from '../redux/actions/groundActions';
import Header from './Header/Header';
 import GroundCard from './GroundCard';
// import BookingModal from './BookingModal';

const UserDashboard = () => {
  const dispatch = useDispatch();
  const { grounds, loading, error } = useSelector(state => state.grounds);
  useEffect(() => {
    dispatch(fetchUserGrounds());
  }, [dispatch]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  let check = grounds;
  console.log(grounds, "userGrounds");

  return (
    <div>
          <Header /> {/* Use Header component here */}
      <h1>Available Grounds</h1>
      <div className="ground-grid">

        {grounds.map(ground => (
          <GroundCard key={ground.id} ground={ground} />
        ))}
      </div>
      {/* <BookingModal /> */}
    </div>
  );
};

export default UserDashboard;
